// import logo from './logo.svg';
import './upload.css';
import React from 'react'

function Upload() {
        return (
            <div id="upload-form">
                <input type="text" id="input-title" className="input" placeholder="Title" />
                <input type="text" id="input-author" className="input" placeholder="Name" />

            </div>
        )
}

export default Upload;
